import React from "react";

class Tictac extends Component {
  render() {
    return (
      <div className="container">
        <h1> Tic Tac App</h1>
        <div className="board">
          <div className="box"></div>
          <div className="box"></div>
          <div className="box"></div>
          <div className="box"></div>
          <div className="box"></div>
          <div className="box"></div>
          <div className="box"></div>
          <div className="box"></div>
          <div className="box"></div>
        </div>
      </div>
    );
  }
}

export default Tictac;
